import React, { useEffect, useState } from "react";
import { useSearchParams } from "react-router-dom";
import axios from "axios";
import {
  Box,
  Typography,
  Grid,
  Checkbox,
  Divider,
  CircularProgress,
} from "@mui/material";

const ComparePage = () => {
  const [searchParams] = useSearchParams();
  const [car1, setCar1] = useState(null);
  const [car2, setCar2] = useState(null);
  const [loading, setLoading] = useState(true);

  useEffect(() => {
    const id1 = searchParams.get("car1");
    const id2 = searchParams.get("car2");

    const fetchCars = async () => {
      try {
        const [res1, res2] = await Promise.all([
          axios.get(`http://localhost:8080/api/cars/${id1}`),
          axios.get(`http://localhost:8080/api/cars/${id2}`),
        ]);
        setCar1(res1.data);
        setCar2(res2.data);
      } catch (err) {
        console.error("Failed to fetch car details:", err);
      } finally {
        setLoading(false);
      }
    };

    fetchCars();
  }, [searchParams]);

  const isNumeric = (val) => !isNaN(parseFloat(val)) && isFinite(val);

  const renderRow = (label, key) => {
    const val1 = car1?.[key];
    const val2 = car2?.[key];

    const isEqual = val1 === val2;

    const highlight = (v, bold) => (
      <Typography
        sx={{
          fontWeight: bold ? "bold" : "normal",
          color: bold ? "green" : "inherit",
        }}
      >
        {v}
      </Typography>
    );

    let cell1 = val1;
    let cell2 = val2;

    if (isNumeric(val1) && isNumeric(val2)) {
      const num1 = parseFloat(val1);
      const num2 = parseFloat(val2);
      cell1 = highlight(val1, num1 > num2);
      cell2 = highlight(val2, num2 > num1);
    } else {
      cell1 = highlight(val1, false);
      cell2 = highlight(val2, false);
    }

    return (
      <Grid container spacing={2} alignItems="center" sx={{ py: 1 }}>
        <Grid item xs={12} md={3}>
          <Typography color="text.secondary">{label}</Typography>
        </Grid>

        <Grid item xs={12} md={4}>
          {cell1}
          {isEqual && <Checkbox checked disabled />}
        </Grid>

        <Grid item xs={12} md={4}>
          {cell2}
          {isEqual && <Checkbox checked disabled />}
        </Grid>
      </Grid>
    );
  };

  if (loading) return <CircularProgress sx={{ m: 5 }} />;
  if (!car1 || !car2)
    return <Typography m={5}>Car data not available.</Typography>;

  return (
    <Box p={4}>
      <Typography variant="h4" gutterBottom textAlign="center">
        🚗 Karşılaştırma Sonucu
      </Typography>

      <Grid
        container
        spacing={4}
        alignItems="center"
        justifyContent="center"
        sx={{ mb: 5 }}
      >
        <Grid item xs={12} md={5} textAlign="center">
          <Typography variant="h6">
            {car1.brand} {car1.model}
          </Typography>
          <Typography variant="body2" color="text.secondary">
            {car1.fuel}
          </Typography>
          {car1.images?.[0] && (
            <img
              src={`data:image/jpeg;base64,${car1.images[0].imageBase64}`}
              alt={`${car1.brand} ${car1.model}`}
              style={{ width: "80%", marginTop: 8 }}
            />
          )}
        </Grid>

        <Grid item xs={12} md={5} textAlign="center">
          <Typography variant="h6">
            {car2.brand} {car2.model}
          </Typography>
          <Typography variant="body2" color="text.secondary">
            {car2.fuel}
          </Typography>
          {car2.images?.[0] && (
            <img
              src={`data:image/jpeg;base64,${car2.images[0].imageBase64}`}
              alt={`${car2.brand} ${car2.model}`}
              style={{ width: "80%", marginTop: 8 }}
            />
          )}
        </Grid>
      </Grid>

      <Divider sx={{ mb: 4 }} />

      {renderRow("Fiyat (₺)", "price")}
      {renderRow("Kilometre", "km")}
      {renderRow("Yıl", "year")}
      {renderRow("Yakıt", "fuel")}
      {renderRow("İletişim", "contact")}
    </Box>
  );
};

export default ComparePage;
